import { createRouter, createWebHistory } from 'vue-router'
import Dashboard from '../views/Dashboard.vue'
import Singin from '../views/auth/Login.vue'
import Departments from '../views/managment/departments'
import Users from '../views/managment/users'
import Roles from '../views/managment/roles'
import Permission from '../views/managment/permissions'
import store from '@/store'

const routes = [
  {
    path: '/',
    name: 'dashboard',
    component: Dashboard,

  },
  {
    path: '/departments',
    name: 'departments',
    component: Departments,
  },
  {
    path: '/users',
    name: 'users',
    component: Users,
  },
  {
    path: '/roles',
    name: 'roles',
    component: Roles,
  },
  {
    path: '/permissions',
    name: 'permissions',
    component: Permission,
  },
  {
    path: '/login',
    name: 'Singin',
    component: Singin,

  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})


export default router
